import React, { useEffect, useState, useContext } from "react";
import axios from "axios";
import NavbarAdmin from "../components/NavbarAdmin";
import { AuthContext } from "../context/AuthContext"; // Assuming AuthContext provides `centreId`
import "./CreateSlots.css";

export default function CreateSlots() {
  const context = useContext(AuthContext);
  const centreId = context.centerId;
  const [courts, setCourts] = useState([]); 
  const [selectedDate, setSelectedDate] = useState(""); 
  const [selectedSlots, setSelectedSlots] = useState([]); 

  const times = [
    "5:00 AM - 6:00 AM", "6:00 AM - 7:00 AM","7:00 AM - 8:00 AM","8:00 AM - 9:00 AM","9:00 AM - 10:00 AM","10:00 AM - 11:00 AM","11:00 AM - 12:00 PM","12:00 PM - 1:00 PM","1:00 PM - 2:00 PM","2:00 PM - 3:00 PM","3:00 PM - 4:00 PM","4:00 PM - 5:00 PM",
    "5:00 PM - 6:00 PM","6:00 PM - 7:00 PM","7:00 PM - 8:00 PM","8:00 PM - 9:00 PM","9:00 PM - 10:00 PM","10:00 PM - 11:00 PM","11:00 PM - 12:00 AM",
  ];

  // Fetch courts for the specific centre
  useEffect(() => {
    const fetchCourts = async () => {
      try {
        const response = await axios.get(
          `${process.env.REACT_APP_BACKENDAPI}/api/court/center/${centreId}`
        );
        setCourts(response.data);
      } catch (error) {
        console.error("Error fetching courts:", error);
      }
    };

    if (centreId) fetchCourts();
  }, [centreId]);

  const handleDateChange = (e) => {
    setSelectedDate(e.target.value);
  };

  const handleSlotChange = (e) => {
    const { value, checked } = e.target;

    if (checked) {
      setSelectedSlots([...selectedSlots, value]);
    } else {
      setSelectedSlots(selectedSlots.filter((slot) => slot !== value));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!selectedDate) {
      alert("Please select a date.");
      return;
    }

    if (selectedSlots.length === 0) {
      alert("Please select at least one time slot.");
      return;
    }

    try {
      // Send POST request for each selected slot
      for (let slot of selectedSlots) {
        for (let court of courts) {
          await axios.post(`${process.env.REACT_APP_BACKENDAPI}/api/booking`, {
            date: selectedDate,
            bookingSlot: slot,
            courtId: court._id, // Use each court's ID
          });
        }
      }

      alert("Slots successfully created.");
    } catch (error) {
      console.error("Error creating bookings", error);
      alert("An error occurred while booking slots.");
    }
  };

  return (
    <div>
      <NavbarAdmin />
      <div className="createslots-form-container">
        <h2>Create Booking Slots</h2>
        <form onSubmit={handleSubmit} className="createslots-form">
          {/* Date Selection */}
          <div className="form-group">
            <label htmlFor="date">Select Date:</label>
            <input
              type="date"
              id="date"
              value={selectedDate}
              onChange={handleDateChange}
              required
            />
          </div>

          {/* Slot Options */}
          <div className="form-group">
            <p>Select Time Slots:</p>
            {times.map((timeSlot, index) => (
              <div key={index} className="slot-options">
                <input
                  type="checkbox"
                  id={timeSlot}
                  value={timeSlot}
                  onChange={handleSlotChange}
                />
                <label htmlFor={timeSlot}>{timeSlot}</label>
              </div>
            ))}
          </div>

          {/* Courts Display */}
          <div className="form-group">
            <p>Available Courts:</p>
            <ul>
              {courts.length > 0 ? (
                courts.map((court) => <li key={court._id}>{court.name}</li>)
              ) : (
                <p>Loading courts...</p>
              )}
            </ul>
          </div>

          {/* Submit */}
          <div className="form-actions">
            <button type="submit" className="submit-btn">
              Submit
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}
